pragma solidity ^0.5.0;
import "./ERC721Full.sol";

contract Token is ERC721Full {

    mapping(address => bool) public allowedToPlay;
    uint public gameFee = 0.1 ether; 
    address public owner; 

    constructor () public {
        owner = msg.sender;
        allowedToPlay[msg.sender] = false;

  }    

    function payToGame() public payable returns (bool) {
        require(msg.value >= gameFee, "Fee not met.");
        allowedToPlay[msg.sender] = true;
        return true;
    }

    function mint(address _to, string memory _tokenURI) public returns(bool) {
        require(allowedToPlay[msg.sender] == true, "Please pay to game.");
        uint _tokenId = totalSupply().add(1);
        _mint(_to, _tokenId);
        _setTokenURI(_tokenId, _tokenURI);
        return true;
    }
}
